import React from 'react';
import { TextField, FormControl, Input, InputLabel } from '@mui/material';
const Contact = () => {
  return (
    <div className=" content bg-color " id="contact">
      <h1>Contact</h1>

      <FormControl>
        <InputLabel htmlFor="my-input" color="info" focused>
          Email address
        </InputLabel>
        <Input id="my-input" aria-describedby="my-helper-text" />
        <InputLabel htmlFor="my-input" color="info" focused>
          Email address
        </InputLabel>
        <Input id="my-input" aria-describedby="my-helper-text" />
        <InputLabel htmlFor="my-input" color="info" focused>
          Email address
        </InputLabel>
        <Input id="my-input" aria-describedby="my-helper-text" />
      </FormControl>
    </div>
  );
};

export default Contact;
